/*Table structure for table `modeofrelease` */

DROP TABLE IF EXISTS `modeofrelease`;

CREATE TABLE `modeofrelease` (
  `id` int(11) NOT NULL,
  `mode` varchar(25) NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `modeofrelease` */

insert  into `modeofrelease`(`id`,`mode`,`status`) values (1,'Pick up',1),(2,'Mail',1),(3,'Fax',1),(4,'Email',1);

/*Table structure for table `notification` */

DROP TABLE IF EXISTS `notification`;

CREATE TABLE `notification` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type_id` int(11) NOT NULL,
  `recipient_id` int(11) NOT NULL,
  `sender_id` int(11) NOT NULL,
  `sender` varchar(50) NOT NULL,
  `message` varchar(100) NOT NULL,
  `controller` varchar(15) NOT NULL,
  `action` varchar(15) NOT NULL,
  `resource_id` int(11) NOT NULL,
  `viewed` int(11) NOT NULL,
  `notificationDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
